def count_z_depth_parameters(camera, one, zero):

    offset =  - (camera - one)
    size = 1.0 / (one - zero)
    return (offset, size, True, 0, True, 1)

def filter_iterations(tree, key=lambda i: i, stop=lambda: False):

    assert callable(stop) or stop in ['any', 'asap']

    tree = list(tree)
    filtered = []
    off = []

    if stop == 'any':
        stop = lambda: len(filtered) > 0
    elif stop == 'asap':
        hits = [i for i in tree if not key(i)]
        stop = lambda: len(filtered) > 0 and len(off) == len(hits)

    for i in tree:
        if key(i):
            filtered.append(i)
        else:
            off.append(i)
        if stop():
            break

    return filtered

def calculate_nfft(samplerate, winlen):

    window_length_samples = winlen * samplerate
    nfft = 1
    while nfft < window_length_samples:
        nfft *= 2
    return nfft

def normalize(array):

    array = (array - array.min()) / (array.max() - array.min())

    return array

def human_format(num):


    num = float("{:.3g}".format(num))
    magnitude = 0
    while abs(num) >= 1000:
        magnitude += 1
        num /= 1000.0
    return "{}{}".format(
        "{:f}".format(num).rstrip("0").rstrip("."), ["", "k", "m", "b", "t"][magnitude]
    )

def hilbertrot(n, x, y, rx, ry):

    if ry == 0:
        if rx == 1:
            x = n - 1 - x
            y = n - 1 - y
        return y, x
    return x, y

