def bool_converter(s):

    answer = bool(s)
    if isinstance(s, str):
        if s in ('False', 'false', '0'):
            answer = False
        elif s in ('True', 'true', '1'):
            answer = True
        else:
            raise ValueError(
                'Expected one of {}, received : {}'.format(
                    ('False', 'false', '0', 'True', 'true', '1'),
                    s
                )
            )
    return answer

def ordinalize(n):

