def compute_tower_height(TS, N_stages: int, top=True, bot=True):

    # 3 m bottoms surge capacity, 1.25 m above top tray to remove entrained liquid
    H = TS*N_stages/1000
    if top:
        H += 1.2672
    if bot:
        H += 3
    return H

