def for_eachsub(pattern, haystack, fn):

    if isinstance(pattern, str):
        pattern = compile(pattern)

    pos = 0
    m = pattern.search(haystack, pos)
    while m:
        haystack = pattern.sub(
            fn(m), haystack, 1)
        pos = m.end()
        m = pattern.search(haystack, pos)

