import torch

def DiceLoss(y_pred, y_true):

    num = 2 * torch.sum(y_pred * y_true, axis=(1,2,3,4))
    denom = torch.sum(torch.pow(y_pred, 2) + torch.pow(y_true, 2), axis=(1,2,3,4))
    return (1 - torch.sum(num / (denom + 1e-6)))

